import React, { useState } from 'react';
import './Navbar.css'; // Importamos los estilos desde archivo CSS

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => setIsOpen(!isOpen);

  return (
    <nav className="navbar">
      <div className="logo">
        Samu<span className="dot">.</span>
      </div>

      <div
        className={`hamburger ${isOpen ? 'open' : ''}`}
        onClick={toggleMenu}
        aria-label="Toggle menu"
      >
        <span></span>
        <span></span>
        <span></span>
      </div>

      <div className={`links-container ${isOpen ? 'open' : ''}`}>
        <a href="#presentacion" onClick={() => setIsOpen(false)}>Inicio</a>
        <a href="#proyectos" onClick={() => setIsOpen(false)}>Proyectos</a>
        <a href="#habilidades" onClick={() => setIsOpen(false)}>Habilidades</a>
      </div>
    </nav>
  );
};

export default Navbar;
